INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "フリーマーケット会場", 10118, 91002, "ペコリーヌとの出会い", 40, 2834, 7, 1, "青空の下で謁見", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 5118061, 0, 2, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "フリーマーケット会場", 10118, 91002, "マホとの出会い", 40, 2835, 7, 1, "未来の騎空団\nマスコット？", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 5118062, 0, 2, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "ランドソル市街地", 10118, 91002, "アキノとの出会い", 40, 2837, 7, 1, "お嬢さまからの\n緊急依頼", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 5118063, 0, 2, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "フリーマーケット会場", 10118, 91002, "ジュンとの出会い", 40, 4108402, 18, 1, "黄金色の悩みごと", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 5118064, 0, 2, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "フリーマーケット会場", 10118, 91002, "カオリとの出会い", 40, 4107402, 18, 1, "白熱！　格闘大会！", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 5118065, 0, 2, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "オーエド町", 10118, 91002, "ニノンとの出会い", 40, 9000227, 16, 1, "祭り太鼓はオーエドの華", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 5118066, 1, 2, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "フリーマーケット会場", 10118, 91002, "スズナとの出会い", 40, 2101181, 19, 1, "人気者は遅れて\nやってくる", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 5118067, 0, 3, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "ランドソル市街地", 10118, 91002, "ナナカとの出会い", 40, 4109402, 18, 1, "巫女・ミーツ・魔法少女", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 5118068, 0, 3, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "フリーマーケット会場", 10118, 91002, "キャル＆コッコロとの出会い", 40, 4305402, 18, 1, "ネズ耳は二度なくなる", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 5118069, 0, 3, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "ランドソル市街地", 10118, 91002, "ユカリとの出会い", 40, 4101402, 18, 1, "この出会いにカンパイ！", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 5118070, 0, 3, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "ランドソル市街地", 10118, 91002, "アオイとの出会い", 40, 4106402, 18, 1, "陰陽アンサンブル", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 5118071, 0, 3, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, "フリーマーケット会場", 10118, 91002, "シノブとの出会い", 40, 2836, 7, 1, "運試し十番勝負！", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 5118072, 1, 3, 8);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (20063115, 0, 10118, 0, "オープニング", 0, 0, 0, 0, "彼女たちの新たな日常", 0, 5118600, 0, 1, 0);
